func parsePartitionStrategy(strategy string) string {
	switch strategy {
	case "list", "LIST", "List":
		return "l"
	case "range", "RANGE", "Range":
		return "r"
	case "hash", "HASH", "Hash":
		return "h"
	default:
		return strategy
	}
}

